import { FETCH_BOOKINGS_SUCCESS } from "../actions/types";

const initialState = {
  bookings: {}
};

export default function(state = initialState, action) {
  switch (action.type) {
      case FETCH_BOOKINGS_SUCCESS:
          console.log('-------here ia am')
        return {         
          ...state,
          bookings: action.payload.bookings,
        }; 
    default:
      return state;
  }
}
